sympy.sympy.core.decorators.binary_op_wr:
@wraps(func)
def binary_op_wrapper(self: T1, other: T2) -> T3:
    if hasattr(other, '_op_priority'):
        if other._op_priority > self._op_priority:  # type: ignore
            f: Union[Callable[[T1], T3], None] = getattr(other, method_name, None)
            if f is not None:
                return f(self)
    return func(self, other)

sympy.sympy.core.decorators.__sympifyit_:
@wraps(func)
def __sympifyit_wrapper(a, b):
    try:
        # If an external class has _op_priority, it knows how to deal
        # with SymPy objects. Otherwise, it must be converted.
        if not hasattr(b, '_op_priority'):
            b = sympify(b, strict=True)
        return func(a, b)
    except SympifyError:
        return retval

