def __mul__(self, other):
    if global_parameters.evaluate:
        if isinstance(other, int):
            return Integer(self.p*other)
        elif isinstance(other, Integer):
            return Integer(self.p*other.p)
        elif isinstance(other, Rational):
            return Rational._new(self.p*other.p, other.q, igcd(self.p, other.q))
        return Rational.__mul__(self, other)
    return Rational.__mul__(self, other)

def __new__(cls, *args, evaluate=False, check=None, _sympify=True):
    if not args:
        return cls.identity

    # This must be removed aggressively in the constructor to avoid
    # TypeErrors from GenericIdentity().shape
    args = list(filter(lambda i: cls.identity != i, args))
    if _sympify:
        args = list(map(sympify, args))
    obj = Basic.__new__(cls, *args)
    factor, matrices = obj.as_coeff_matrices()

    if check is not None:
        sympy_deprecation_warning(
            "Passing check to MatMul is deprecated and the check argument will be removed in a future version.",
            deprecated_since_version="1.11",
            active_deprecations_target='remove-check-argument-from-matrix-operations')

    if check is not False:
        validate(*matrices)

    if not matrices:
        # Should it be
        #
        # return Basic.__neq__(cls, factor, GenericIdentity()) ?
        return factor

    if evaluate:
        return cls._evaluate(obj)

    return obj
